import React, { Component } from 'react'

class WelcomeState extends Component {

    constructor() {
        super();
        this.state = {
            message: "Welcome Visitor"
        }
    }

    render() {
        return (<div><h1> {this.state.message} </h1></div>)
    }
}

export default WelcomeState
